function Home() {

    const [homeData, setHomeData] = useState();

    
  useEffect(() => {
     
    fetch(
      'https://www.themealdb.com/api/json/v1/1/filter.php?a=Indian'
    )
      .then((response) => response.json())
      .then((data) => {
        setHomeData(data.meals[0])
      
      })
      .catch(() => {
        console.log("error");
      })},[])
  return (
      <>
    
{ <div>
     <h1>Indian Cusisine</h1>
     {/* <img className={classes.img} src={recipe.strMealThumb} alt="Biryani.jpg" /> */}
     {homeData.map(item=>(
         <>
       <p key={item.key}>{item.strMeal}</p>
       <h1>Instructions :-{item.strMealThumb}</h1>
       </>
     ))}
    
      
    </div> }
    </>
  )
}

